import React from "react";

function MenuList() {
  return (
    <div>
      {notes.map((note) => (
        <NotesItem
          key={note.id}
          id={note.id}
          isArchived={note.archived}
          {...note}
        />
      ))}
    </div>
  );
}

export default MenuList;
